 class Images extends Component {
    render() {

        function importAll(r) {
            let images = {};
            r.keys().map((item, index) => { images[item.replace('./', '')] = r(item); });
            return images;
        }

        const images = importAll(require.context('./portfolio', false, '/\.png/'|| './portfolio', false, '/\.jpg/'));

        <img src={images['1.jpg']} />
